def decrypt(im_name):
    # Open image
    im = Image.open(im_name)
    last_bits_array = []         # array of last digits 0 or 1
    bi_array = []                # array of binary groups of 8
    data_array = np.asarray(im)  # array of 0 -> 255

    length = 300000
    k = 0
    l = 0
    while length > 0:
        temp = format(data_array[k][l][2], '08b')
        last_bits_array.append(temp[len(temp) - 1])

        if l == len(data_array[0]) - 1:
            k += 1
            l = 0
        else:
            l += 1
        length -= 1

    i = 0
    while i < len(last_bits_array)-8:
        one_string = ""
        for j in range(i, i+8):
            one_string += last_bits_array[j]
        bi_array.append(one_string)
        i += 8

    # print(last_bits_array)
    # print(len(bi_array))

    ascii_string = ""
    for value in bi_array:
        an_integer = int(value, 2)
        ascii_char = chr(an_integer)
        ascii_string += ascii_char

    print(ascii_string)

